import React from 'react';
import MailchimpSubscribe from "react-mailchimp-subscribe"

const url = "https://3box.us19.list-manage.com/subscribe/post?u=5a9411d6043824e844bff724b&amp;id=a4851c7de4";

const MailChimp = () => <MailchimpSubscribe url={url}/>

export default MailChimp;
